$(document).ready(()=>{$.ajax({url:"http://localhost:4000/user/transactions/",method:"GET",crossDomain:!0,xhrFields:{withCredentials:!1},success:t=>{t&&t.forEach((t,e)=>{var a,n;switch(t.status){case"approved":a="Payment Approved",n="success";break;case"pending":a="Payment Pending",n="secondary";break;case"rejected":default:a="Payment Rejected",n="danger"}t=`
                                        <tr>
                                            <td>${t.id}</td>
                                            <td>${t.name}</td>
                                            <td>
                                                <span class="badge badge-${n}" id="payment-status">${a}</span>
                                            </td>
                                            <td>
                                            <a href="#">
                                                <button type="button" class="btn btn-primary">View Payment</button>
                                            </a>
                                            <a href="./property-info.html">
                                                <button type="button" class="btn btn-info">View Property</button>
                                            </a>
                                            </td>
                                        </tr>
                                        `;$("#table_data").append(t)})},error:t=>{console.log(t)}})});